import React from "react";
import { Button } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";


// Redux Imports
import { useDispatch } from "react-redux";
import { useSelector } from "react-redux";
import { BG_KEY } from "../redux/bgRedux/bgReducer";
import { changeBG } from "../redux/bgRedux/bg.actions";


const useStyles = makeStyles({
    container: {
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
    },
    row1_button_1: {
      width: "10px",
      margin: "1em",
      backgroundColor: "#FFF",
      color: "#852121",
      border: "2px solid #852121",
    },
    row1_button_2: {
      width: "10px",
      margin: "1em",
      backgroundColor: "#FFF",
      color: "#5E4FDB",
      border: "2px solid #5E4FDB",
    },
    row1_button_3: {
      width: "10px",
      margin: "1em",
      backgroundColor: "#FFF",
      color: "#FFF",
      border: "2px solid #FFE3E3",
    },
    row2_button_1: {
      width: "10px",
      margin: "1em",
      backgroundColor: "#0E4316",
      color: "#FFF",
    },
    row2_button_2: {
      width: "10px",
      margin: "1em",
      backgroundColor: "#5E4FDB",
      color: "#FFF",
    },
    row2_button_3: {
      width: "10px",
      margin: "1em",
      backgroundColor: "#1ABC9C",
      color: "#FFF",
    },
  });




const SmallButtons = () => {
    const styles = useStyles();
  return (
    <div className={styles.container}>
      <div className={styles.row}>
        <Button
          variant="contained"
          color="primary"
          className={styles.row1_button_1}
        >
          -
        </Button>
        <Button
          variant="contained"
          color="primary"
          className={styles.row1_button_2}
        >
          +
        </Button>
        <Button
          variant="contained"
          color="primary"
          className={styles.row1_button_3}
        >
          &#10004;
        </Button>
      </div>
      <div className={styles.row}>
        <Button
          variant="contained"
          color="primary"
          className={styles.row2_button_1}
        >
          -
        </Button>
        <Button
          variant="contained"
          color="primary"
          className={styles.row2_button_2}
        >
          +
        </Button>
        <Button
          variant="contained"
          color="primary"
          className={styles.row2_button_3}
        >
          &#10004;
        </Button>
      </div>
    </div>
  );
};

export default SmallButtons;
